--
-- Table structure for table `bundles`
--

DROP TABLE IF EXISTS `bundles`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `bundles` (
  `id` int unsigned NOT NULL AUTO_INCREMENT,
  `ecommerce_product_id` int DEFAULT NULL,
  `bundle_name` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `bundle_sku` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci NOT NULL,
  `vendor_bundle_id` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL COMMENT 'Vendor Bundle Identifier',
  `bundle_cost_to_gdt` decimal(10,2) DEFAULT NULL COMMENT 'Cost of Bundle to GDT in currency',
  `shipping_weight` decimal(10,2) DEFAULT NULL COMMENT 'Shipping weight in kilograms',
  `bndl_std_price` decimal(15,2) DEFAULT NULL,
  `prod_purc_req` int DEFAULT NULL,
  `bulk_shipment` int DEFAULT NULL,
  `indiv_shipment` int DEFAULT NULL,
  `obs_req_test_purc` int DEFAULT NULL,
  `obs_alw_test_purc` int DEFAULT NULL,
  `obs_alw_no_test_purc` int DEFAULT NULL,
  `is_active` int DEFAULT '1' COMMENT '1 is default active',
  `status` int DEFAULT '1' COMMENT 'ACTIVE: 1, INACTIVE: 2, NEEDS_REVIEW: 3, AVAILABLE_FOR_INCLUSION: 4, AVAILABLE_BUT_NOT_OFFERING: 5',
  `statusDate` datetime DEFAULT NULL COMMENT 'Date when the status was last updated',
  `LoginSessionID` int DEFAULT NULL COMMENT 'Reference to the login_sessions table',
  `ecommerce_sync` int DEFAULT '0',
  `bundle_description` text CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci,
  `deleted_at` timestamp NULL DEFAULT NULL,
  `external_id` varchar(150) CHARACTER SET utf8mb4 COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  `prepare_outbound_shipping_label` int DEFAULT NULL,
  `prepare_inbound_shipping_label` int DEFAULT NULL,
  `send_outbound_shipping_label` int DEFAULT NULL,
  `send_inbound_shipping_label` int DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `measurement` varchar(150) COLLATE utf8mb4_unicode_ci DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `LoginSessionID` (`LoginSessionID`),
  CONSTRAINT `bundles_ibfk_1` FOREIGN KEY (`LoginSessionID`) REFERENCES `login_sessions` (`id`) ON DELETE SET NULL ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=43 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_unicode_ci;
/*!40101 SET character_set_client = @saved_cs_client */;

