INSERT INTO `message_templates` VALUES (1,5,1,1,'Thank you for your COVID-19 Test Purchase from Atlantic Council!','<!-- [if gte mso 15]>\r\n        <xml>\r\n            <o:OfficeDocumentSettings>\r\n            <o:AllowPNG/>\r\n            <o:PixelsPerInch>96</o:PixelsPerInch>\r\n            </o:OfficeDocumentSettings>\r\n        </xml>\r\n        <![endif]--><!--*|END:IF|*--><center>\r\n<table id=\"bodyTable\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"center\">\r\n<tbody>\r\n<tr>\r\n<td id=\"bodyCell\" align=\"center\" valign=\"top\"><!-- BEGIN TEMPLATE // --> <!-- [if (gte mso 9)|(IE)]>\r\n                        <table align=\"center\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"600\" style=\"width:600px;\">\r\n                        <tr>\r\n                        <td align=\"center\" valign=\"top\" width=\"600\" style=\"width:600px;\">\r\n                        <![endif]-->\r\n<table class=\"templateContainer\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td id=\"templateBody\" valign=\"top\">\r\n<table class=\"mcnTextBlock\" style=\"min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"padding-top: 9px;\" valign=\"top\">\r\n<table class=\"mcnTextContentContainer\" style=\"max-width: 100%; min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"padding: 0 18px 9px 18px;\" valign=\"top\">\r\n<h1 class=\"null\" style=\"text-align: center;\"><span style=\"font-size: 18px;\">Hello {customer_name},</span></h1>\r\n<h1 class=\"null\" style=\"text-align: center;\"><span style=\"color: #3399cc;\"><strong>The following details are about what will happen next with your COVID-19 test purchase.</strong></span></h1>\r\n<h1 class=\"null\" style=\"text-align: center;\">* * *</h1>\r\n<h4 class=\"null\" style=\"text-align: center;\"><span style=\"color: #3399cc;\"><span style=\"font-size: 22px;\"><strong>Assign Tests to Recipients</strong></span></span><br /><br /><span style=\"font-size: 16px;\">You indicated with your purchase that you will individually assign tests to recipients to receive their personal shipments.</span></h4>\r\n&nbsp;\r\n<div style=\"text-align: center;\"><span style=\"font-size: 16px;\"><strong>You may assign recipients by entering them into your Account in one of two ways:</strong></span></div>\r\n<ul>\r\n<li style=\"text-align: center;\">Upload an Excel spreadsheet containing recipient information</li>\r\n</ul>\r\n<div style=\"text-align: center;\"><span style=\"color: #3399cc;\">(a template is available within the application)</span></div>\r\n<ul>\r\n<li style=\"text-align: center;\">You have paid for shipping in advance, so there are no additional shipping charges unless you choose to upgrade the shipping speed from your prepaid setting [SHIPPING METHOD] in order to receive tests sooner.</li>\r\n</ul>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<!-- [if mso]>\r\n				</td>\r\n				<![endif]--> <!-- [if mso]>\r\n				</tr>\r\n				</table>\r\n				<![endif]--></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnDividerBlock\" style=\"min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnDividerBlockOuter\">\r\n<tr>\r\n<td class=\"mcnDividerBlockInner\" style=\"min-width: 100%; padding: 18px;\">\r\n<table class=\"mcnDividerContent\" style=\"min-width: 100%; border-top-width: 2px; border-top-style: solid; border-top-color: #3399CC;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody>\r\n<tr>\r\n<td>&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<!--\r\n                <td class=\"mcnDividerBlockInner\" style=\"padding: 18px;\">\r\n                <hr class=\"mcnDividerContent\" style=\"border-bottom-color:none; border-left-color:none; border-right-color:none; border-bottom-width:0; border-left-width:0; border-right-width:0; margin-top:0; margin-right:0; margin-bottom:0; margin-left:0;\" />\r\n--></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnBoxedTextBlock\" style=\"min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\"><!-- [if gte mso 9]>\r\n	<table align=\"center\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\r\n	<![endif]-->\r\n<tbody class=\"mcnBoxedTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnBoxedTextBlockInner\" valign=\"top\"><!-- [if gte mso 9]>\r\n				<td align=\"center\" valign=\"top\" \">\r\n				<![endif]-->\r\n<table class=\"mcnBoxedTextContentContainer\" style=\"min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\" align=\"left\">\r\n<tbody>\r\n<tr>\r\n<td style=\"padding: 9px 18px 9px 18px;\">\r\n<table class=\"mcnTextContentContainer\" style=\"min-width: 100% !important; background-color: #3399cc;\" border=\"0\" width=\"100%\" cellspacing=\"0\">\r\n<tbody>\r\n<tr>\r\n<td class=\"mcnTextContent\" style=\"padding: 18px; color: #f2f2f2; font-family: Helvetica; font-size: 14px; font-weight: normal; text-align: center;\" valign=\"top\">\r\n<div style=\"text-align: center;\"><span style=\"font-size: 16px;\"><strong>If you created an account for your order, you can access it here:</strong></span></div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<!-- [if gte mso 9]>\r\n				</td>\r\n				<![endif]--> <!-- [if gte mso 9]>\r\n                </tr>\r\n                </table>\r\n				<![endif]--></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnButtonBlock\" style=\"min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnButtonBlockOuter\">\r\n<tr>\r\n<td class=\"mcnButtonBlockInner\" style=\"padding: 0 18px 18px 18px;\" align=\"center\" valign=\"top\">\r\n<table class=\"mcnButtonContentContainer\" sty