bservation Session(s).</strong></span><br />&nbsp;<strong><span style=\"color: #3399cc;\">*Please ensure that&nbsp;Recipients know&nbsp;they are NOT TO OPEN their tests prior to being instructed to&nbsp; during the Video Observation Process. This is to ensure valid test results.</span></strong><!-- [if mso]>\r\n				</td>\r\n				<![endif]--> <!-- [if mso]>\r\n				</tr>\r\n				</table>\r\n				<![endif]--><br /><!--            \r\n                <td class=\"mcnDividerBlockInner\" style=\"padding: 18px;\">\r\n                <hr class=\"mcnDividerContent\" style=\"border-bottom-color:none; border-left-color:none; border-right-color:none; border-bottom-width:0; border-left-width:0; border-right-width:0; margin-top:0; margin-right:0; margin-bottom:0; margin-left:0;\" />\r\n--><!-- [if gte mso 9]>\r\n	<table align=\"center\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\">\r\n	<![endif]--><!-- [if gte mso 9]>\r\n				<td align=\"center\" valign=\"top\" \">\r\n				<![endif]--><span style=\"font-size: 16px;\"><strong>If you created an account for your order, click below to&nbsp;access:</strong></span><!-- [if gte mso 9]>\r\n				</td>\r\n				<![endif]--> <!-- [if gte mso 9]>\r\n                </tr>\r\n                </table>\r\n				<![endif]--><a class=\"mcnButton \" style=\"font-weight: bold; letter-spacing: normal; line-height: 100%; text-align: center; text-decoration: none; color: #ffffff;\" title=\"MY ACCOUNT\" href=\"{login_url}\" target=\"_blank\" rel=\"noopener\">MY ACCOUNT</a><br /><!--            \r\n                <td class=\"mcnDividerBlockInner\" style=\"padding: 18px;\">\r\n                <hr class=\"mcnDividerContent\" style=\"border-bottom-color:none; border-left-color:none; border-right-color:none; border-bottom-width:0; border-left-width:0; border-right-width:0; margin-top:0; margin-right:0; margin-bottom:0; margin-left:0;\" />\r\n--><!-- [if (gte mso 9)|(IE)]>\r\n                                    <table align=\"center\" border=\"0\" ce