ort video, then take a screen shot on the screen shot page and click Save to finish your session.&nbsp;</span></p>\r\n<p class=\"p1\" style=\"margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 13px; line-height: normal; font-family: \'Helvetica Neue\';\">&nbsp;</p>\r\n<p class=\"p1\" style=\"margin: 0px; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 13px; line-height: normal; font-family: \'Helvetica Neue\';\"><span style=\"font-size: 12pt; font-family: arial, helvetica, sans-serif;\">If you have any questions regarding your At-Home COVID-19 test or Observation Session, please reach out to Adam Stubits (<a href=\"mailto:astubits@atlanticcouncil.org\"><span class=\"s1\" style=\"color: #dca10d;\">astubits@atlanticcouncil.org</span></a>) and Alyssa Lufman (<a href=\"mailto:alufman@atlanticcouncil.org)\"><span class=\"s1\" style=\"color: #dca10d;\">alufman@atlanticcouncil.org)</span></a></span></p>\r\n</div>\r\n</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<!-- [if mso]>\r\n				</td>\r\n				<![endif]--> <!-- [if mso]>\r\n				</tr>\r\n				</table>\r\n				<![endif]--></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnTextBlock\" style=\"min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpadding=\"0\">\r\n<tbody class=\"mcnTextBlockOuter\">\r\n<tr>\r\n<td class=\"mcnTextBlockInner\" style=\"padding-top: 9px;\" valign=\"top\"><!-- [if mso]>\r\n				<table align=\"left\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"100%\" style=\"width:100%;\">\r\n				<tr>\r\n				<![endif]--> <!-- [if mso]>\r\n				<td valign=\"top\" width=\"600\" style=\"width:600px;\">\r\n				<![endif]--><!-- [if mso]>\r\n				</td>\r\n				<![endif]--> <!-- [if mso]>\r\n				</tr>\r\n				</table>\r\n				<![endif]--></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<table class=\"mcnButtonBlock\" style=\"min-width: 100%;\" border=\"0\" width=\"100%\" cellspacing=\"0\" cellpaddin